Трое пермских сотрудников ОМОН погибли в ходе спецоперации на Украине. Информацию об этом официально подтвердили власти Пермского края.

"Они посвятили себя служению России и до конца остались верными воинской присяге. Глубочайшие соболезнования родным и близким. Наши сыновья, мужья, братья навсегда останутся для нас примером отваги и героизма. Мы скорбим вместе с вами", — отметил пермский губернатор Дмитрий Махонин.

